import logo from './logo.svg';
import './App.css';
import Item from "./component/Item";
import ItemDate from './component/ItemDate';


function App() {
  const response=[
    {
      name:"nirma",
      date:"20",
      month:"july",
      year:"2020"
    },
    {
      name:"surfxl",
      date:"9",
      month:"june",
      year:"2020"
    },
    {
      name:"555",
      date:"2",
      month:"april",
      year:"2020"
    }

  ]
  return (
    <div>
        <Item name={response[0].name} >
          1st item
        </Item>
        <ItemDate day={response[0].date} month={response[0].month} year={response[0].year}></ItemDate>

        <Item name={response[1].name}></Item>
        <ItemDate day={response[1].date} month={response[1].month} year={response[1].year}></ItemDate>

        <Item name={response[2].name}></Item>
        <ItemDate day={response[2].date} month={response[2].month} year={response[2].year}></ItemDate>

        <div className="App">
           Hello Ji
        </div>
    </div>

  );
}

export default App;
